import React, { useEffect, useState } from "react";
import Typography from "@mui/material/Typography";
import {
  Button,
  Grid,
  List,
  ListItem,
  ListItemText,}from "@mui/material";
import { child, get, getDatabase,query,ref, set,onChildAdded,onValue, equalTo,orderByChild,remove } from "firebase/database";
import NavBar from "./components/Navbar";
import { Link } from "react-router-dom";

import "./adminDash.css";
import ManageUsers from "./ManageUsers";



export default function AdminDash() {
  let [show, setShow] = useState()
  let rows = []

function readData(){
  const dbQueryRef = query(ref(getDatabase(), 'users'))

  onValue(dbQueryRef, (snapshot) => {
    setShow(snapshot.val())
    console.log(snapshot.val())
  })
  for(let j in userData){
    userData[j].UserId = j
    rows.push(userData[j])
  }
}

useEffect(() =>{
readData()
} , [])

  return (
    <>
      <NavBar />
      <Grid
        container
        sx={{
          padding: "10em 7em 4em",
        }}
      >
        <Grid
          item
          width={"50%"}
          sx={{
            // border: "1em dotted yellow",
            padding: "2em",
          }}
        >
          <div className="admin_widget">
            <List component="nav">
              <ListItem>
                <ListItemText>ADMIN DASHBOARD</ListItemText>
              </ListItem>
              <ListItem button divider className="list_btn">
                <ListItemText primary="View Users" />
              </ListItem>
              <Link to="/signup">
              <ListItem button divider className="list_btn">
                <ListItemText primary="Add Users" />
              </ListItem>
              </Link>
              <ListItem button divider className="list_btn">
                <ListItemText primary="Check Image" />
              </ListItem>
            </List>
          </div>
        </Grid>
        <Grid
          item
          width={"50%"}
          sx={{
            // border: "1em solid yellow",
            padding: "2em",
          }}
        >
          <ManageUsers  userData={userData}></ManageUsers>
        </Grid>
      </Grid>
    </>
  );
}
